                                <i class=\"fa fa-eye\"></i>
                            </button>
                        </div>
                    </div>
                    {{ form_help(form.password) }}
                </div>
            </div>
            {{ form_row(form.save) }}
            {{ form_end(form) }}
        </div>
    </div>

    <script>
        \$(function () {
            var type = \$('#external_contest_source_type');
